function Search(n,t){for(var e=n.value.toLowerCase(),f=document.getElementById(t.id),r=f.getElementsByTagName("li"),u=0,i=0;i<r.length;i++)val=r[i].textContent||r[i].innerText,u<10&&val.toLowerCase().indexOf(e)>-1?(r[i].style.display="",u++):r[i].style.display="none",u==9&&(end=document.getElementById("end"),end.style.display="");f.style.display=""}